import React, {useState, useEffect} from 'react';
import axios from 'axios';
import Key from '../Key';


const Current = (props) => {
    let zipCode = props.zipCode;
    const [data, setData] = useState(null);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

  useEffect(() => {
    const getData = async () => {
      try {
        const response = await axios.get(
            `http://api.weatherapi.com/v1/current.json?key=${Key}&q=${zipCode}`
        );
        setData(response.data);
        setError(null);
        console.log(data);
      } catch (err) {
        setError(err.message);
        setData(null);
      } finally {
        setLoading(false);
      }
    };
    getData();
  }, [loading]);

    return (
        <div>
            <h1>Current Weather for: {data.location.name}</h1>

            <p>Temperature: {data.current.temp_f} F</p>
            <p><img src={data.current.condition.icon} alt="weather_icon" /></p>
            <p>{data.condition.text}</p>
            <p>UV Index: {data.current.uv}</p>
            <p>Humidity: {data.current.humidity}%</p>
            <p>Precipitation: {data.current.precip_in} Inches</p>

        </div>

    );

    };

export default Current;
